        // While there are characters toc compare 
        while (i < j) { 

            // If there is a mismatch 
            if (str.charAt(i) != str.charAt(j)) 
                return false; 

            // Increment first pointer and 
            // decrement the other 
            i++; 
            j--; 
        } 

        // Given string is a palindrome 
        return true; 
